(13,51,'PRI3','PRO2','PAY3','SPE3','20-22 Dương Quang Trung, Phường 12, Quận 1false, Tp. HCM','','2023-01-18 15:48:24','2023-02-05 09:08:27','CLI3',false,false,'<p>Gần 30 năm kinh nghiệm lĩnh vực Nội Tổng quát - Da liễu</p>\n<p>Hiện công tác tại Phòng khám Bệnh viện Đại học Y Dược 1</p>\n<p>Từng công tác tại Bệnh viện Trưng Vương</p>\n','Gần 30 năm kinh nghiệm lĩnh vực Nội Tổng quát - Da liễu\n\nHiện công tác tại Phòng khám Bệnh viện Đại học Y Dược 1\n\nTừng công tác tại Bệnh viện Trưng Vương\n','<h3><strong>Bác sĩ Chuyên khoa I Trương Thị Tuyết Hoa</strong></h3>\n<ul>\n<li>Gần 30 năm kinh nghiệm lĩnh vực Nội Tổng quát - Da liễu</li>\n<li>Hiện công tác tại Phòng khám Bệnh viện Đại học Y Dược 1</li>\n<li>Từng công tác tại Bệnh viện Trưng Vương</li>\n</ul>\n<h3><strong>Khám và điều trị</strong></h3>\n<ul>\n<li>Bệnh da dị ứng: Mày đay, viêm da cơ địa, viêm da tiếp xúc, sẩn ngứa…</li>\n<li>Các bệnh da do vi khuẩn, nấm, ký sinh trùng: Viêm mô bào, viêm nang lông, chốc, chàm vi khuẩn, nấm, ghẻ…</li>\n<li>Các bệnh da do virus: Thủy đậu, zona thần kinh, mụn cóc, u mềm lây…</li>\n<li>Các bệnh lây qua đường tình dục: Lậu, giang mai, sùi mào gà, herpes sinh dục…</li>\n<li>Các bệnh da khác: U ống tuyến mồ hôi, u mềm treo, viêm da tiết bã, sẩn cục, dày sừng da dầu, dày sừng ánh sáng, bớt tuyến bã…</li>\n<li>Thẩm mỹ nội khoa: trứng cá, sẹo lõm trứng cá, sẹo lồi, tiêm Mesotherapy, tiêm Botulinum Toxin, phi kim trẻ hóa, công nghệ HIFU, laser CO2 Fractional, laser điều trị sắc tố…</li>\n</ul>\n<h3><strong>Quá trình công tác</strong></h3>\n<ul>\n<li>Bác sĩ Nội Tổng quát – Da liễu, Phòng khám Bệnh viện Đại học Y Dược 1 (2019 - Nay)</li>\n<li>Bác sĩ Nội Tổng quát – Da liễu, Phòng khám Phước An (2015 - 2018)</li>\n<li>Bác sĩ Nội Tổng quát – Da liễu, Bệnh viện Trưng Vương TP. HCM (1997 - 2015)</li>\n</ul>\n<h3><strong>Quá trình đào tạo</strong></h3>\n<ul>\n<li>Học Chuyên khoa I Chuyên ngành Da liễu (2006 - 2008)</li>\n<li>Học Bác sĩ Đa khoa Trường Đại học Y Dược TP. HCM (1991 - 1997)</li>\n</ul>\n<h3><strong>Thành viên các Hội khoa học, tổ chức chuyên môn</strong></h3>\n<ul>\n<li>Hội Gan Mật</li>\n<li>Hội Nội tiết</li>\n</ul>\n','### **Bác sĩ Chuyên khoa I Trương Thị Tuyết Hoa**\n* Gần 30 năm kinh nghiệm lĩnh vực Nội Tổng quát - Da liễu\n* Hiện công tác tại Phòng khám Bệnh viện Đại học Y Dược 1\n* Từng công tác tại Bệnh viện Trưng Vương\n\n\n### **Khám và điều trị**\n* Bệnh da dị ứng: Mày đay, viêm da cơ địa, viêm da tiếp xúc, sẩn ngứa…\n* Các bệnh da do vi khuẩn, nấm, ký sinh trùng: Viêm mô bào, viêm nang lông, chốc, chàm vi khuẩn, nấm, ghẻ…\n* Các bệnh da do virus: Thủy đậu, zona thần kinh, mụn cóc, u mềm lây…\n* Các bệnh lây qua đường tình dục: Lậu, giang mai, sùi mào gà, herpes sinh dục…\n* Các bệnh da khác: U ống tuyến mồ hôi, u mềm treo, viêm da tiết bã, sẩn cục, dày sừng da dầu, dày sừng ánh sáng, bớt tuyến bã…\n* Thẩm mỹ nội khoa: trứng cá, sẹo lõm trứng cá, sẹo lồi, tiêm Mesotherapy, tiêm Botulinum Toxin, phi kim trẻ hóa, công nghệ HIFU, laser CO2 Fractional, laser điều trị sắc tố…\n\n\n### **Quá trình công tác**\n* Bác sĩ Nội Tổng quát – Da liễu, Phòng khám Bệnh viện Đại học Y Dược 1 (2019 - Nay)\n* Bác sĩ Nội Tổng quát – Da liễu, Phòng khám Phước An (2015 - 2018)\n* Bác sĩ Nội Tổng quát – Da liễu, Bệnh viện Trưng Vương TP. HCM (1997 - 2015)\n\n### **Quá trình đào tạo**\n* Học Chuyên khoa I Chuyên ngành Da liễu (2006 - 2008)\n* Học Bác sĩ Đa khoa Trường Đại học Y Dược TP. HCM (1991 - 1997)\n\n### **Thành viên các Hội khoa học, tổ chức chuyên môn**\n* Hội Gan Mật\n* Hội Nội tiết'),
