Y dược TPHCM (2015)\n* Tốt nghiệp Bác sĩ đa khoa, Đại học Y khoa Phạm Ngọc Thạch (2011)\n\n### **Tư vấn từ xa**\n\nBác sĩ khám và tư vấn từ xa về các bệnh lý Nội khoa:\n\n* Cơ xương khớp\n* Nội Tổng quát\n* Khám sức khỏe định kỳ theo nhu cầu'),
(23,87,'PRI5','PRO1','PAY2','SPE1','','','2023-02-05 11:18:34','2023-02-05 11:19:38','',false,true,'<p>Bác sĩ Chuyên khoa Cơ Xương Khớp</p>\n<p>Bác sĩ tại khoa Chi dưới, Bệnh viện Hữu nghị Việt Đức</p>\n<p>Nhiều năm kinh nghiệm trong khám và điều trị các vấn đề liên quan đến chi dưới</p>\n','Bác sĩ Chuyên khoa Cơ Xương Khớp\n\nBác sĩ tại khoa Chi dưới, Bệnh viện Hữu nghị Việt Đức\n\nNhiều năm kinh nghiệm trong khám và điều trị các vấn đề liên quan đến chi dưới','<h3><strong>Thạc sĩ, Bác sĩ Nguyễn Minh Anh</strong></h3>\n<ul>\n<li>Bác sĩ Cơ Xương Khớp</li>\n<li>Bác sĩ tại khoa Chi dưới, Bệnh viện Hữu nghị Việt Đức</li>\n<li>Nhiều năm kinh nghiệm trong khám và điều trị các vấn đề liên quan đến chi dưới</li>\n</ul>\n<h3><strong>Công trình Nghiên cứu Khoa học</strong></h3>\n<ul>\n<li>Luận văn thạc sỹ đánh giá kết quả điều tri vỡ ổ cối và sai khớp háng.</li>\n</ul>\n<h3><strong>Tư vấn từ xa</strong></h3>\n<p><strong>Bác sĩ nhận tư vấn, khám chữa từ xa về:</strong></p>\n<ul>\n<li>Thoái hóa khớp</li>\n<li>Đau gối, đau háng, đau hông</li>\n<li>Đau cổ chân</li>\n<li>Đau các ngón chân, đau cổ chân, bàn chân</li>\n<li>Bệnh Gout</li>\n<li>Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân</li>\n<li>Đau nhiều khớp</li>\n<li>Hoại tử vô khuẩn chỏm xương đùi, hoại tử vô mạch</li>\n<li>Đau xương bánh chè</li>\n<li>Viêm màng hoạt dịch (khớp gối, háng, cổ chân, khớp khủy)</li>\n<li>Teo cơ chân</li>\n<li>Biến dạng khớp bàn chân, khớp gối, đi lạch bạch, yếu cơ, đau mỏi cơ</li>\n<li>Sưng khớp, nóng khớp, đỏ khớp, đau khớp</li>\n<li>Dị dạng khớp, dị dạng xương</li>\n<li>Teo cơ Delta</li>\n<li>Viêm gân gót, Viên gân Asin, Viêm gân gan chân</li>\n<li>Gai xương gót</li>\n<li>Viêm mỏm trâm trụ (châm trụ)</li>\n<li>Viêm mỏm châm quay (châm quay)</li>\n<li>Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai</li>\n<li>Viêm điểm bám gân lồi cầu trong xương đùi</li>\n<li>Viêm điểm bám gân lồi cầu ngoài xương đùi</li>\n<li>Viêm lồi cửa trước xương chày</li>\n<li>Viêm xương, Viêm cơ</li>\n<li>Thoái hóa sụn khớp, Rách sụn trên</li>\n<li>Viêm khớp ngón chân cái, Viêm khớp bàn ngón chân cái</li>\n<li>Đau thần kinh đùi bì</li>\n<li>Viêm gân gấp ngón tay, Viêm gân duỗi</li>\n<li>Rách dây chằng chéo trước, sau</li>\n</ul>\n','\n### **Thạc sĩ, Bác sĩ Nguyễn Minh Anh**\n* Bác sĩ Cơ Xương Khớp\n* Bác sĩ tại khoa Chi dưới, Bệnh viện Hữu nghị Việt Đức\n* Nhiều năm kinh nghiệm trong khám và điều trị các vấn đề liên quan đến chi dưới\n\n### **Công trình Nghiên cứu Khoa học**\n\n* Luận văn thạc sỹ đánh giá kết quả điều tri vỡ ổ cối và sai khớp háng.\n\n\n### **Tư vấn từ xa**\n\n**Bác sĩ nhận tư vấn, khám chữa từ xa về:**\n\n* Thoái hóa khớp\n* Đau gối, đau háng, đau hông\n* Đau cổ chân\n* Đau các ngón chân, đau cổ chân, bàn chân\n* Bệnh Gout\n* Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân\n* Đau nhiều khớp\n* Hoại tử vô khuẩn chỏm xương đùi, hoại tử vô mạch\n* Đau xương bánh chè\n* Viêm màng hoạt dịch (khớp gối, háng, cổ chân, khớp khủy)\n* Teo cơ chân\n* Biến dạng khớp bàn chân, khớp gối, đi lạch bạch, yếu cơ, đau mỏi cơ\n* Sưng khớp, nóng khớp, đỏ khớp, đau khớp\n* Dị dạng khớp, dị dạng xương\n* Teo cơ Delta\n* Viêm gân gót, Viên gân Asin, Viêm gân gan chân\n* Gai xương gót\n* Viêm mỏm trâm trụ (châm trụ)\n* Viêm mỏm châm quay (châm quay)\n* Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai\n* Viêm điểm bám gân lồi cầu trong xương đùi\n* Viêm điểm bám gân lồi cầu ngoài xương đùi\n* Viêm lồi cửa trước xương chày\n* Viêm xương, Viêm cơ\n* Thoái hóa sụn khớp, Rách sụn trên\n* Viêm khớp ngón chân cái, Viêm khớp bàn ngón chân cái\n* Đau thần kinh đùi bì\n* Viêm gân gấp ngón tay, Viêm gân duỗi\n* Rách dây chằng chéo trước, sau'),
