VALUES (2,'SPE1','<h2>Cơ Xương Khớp</h2>\n<p><strong>Bác sĩ Cơ Xương Khớp giỏi</strong></p>\n<p>Danh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệm</li>\n<li>Các giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu Khoa Cơ Xương Khớp - Bệnh viện Bạch Mai, Bệnh viện Hữu nghị Việt Đức,Bệnh Viện E.</li>\n<li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Cơ Xương Khớp, Hội Thấp khớp học,...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</li>\n</ul>\n<p><strong>Bệnh Cơ Xương Khớp</strong></p>\n<ul>\n<li>Gout</li>\n<li>Thoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổ</li>\n<li>Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân</li>\n<li>Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai</li>\n<li>Loãng xương, đau nhức xương</li>\n<li>Viêm xương, gai xương</li>\n<li>Viêm cơ, Teo cơ, chứng đau mỏi cơ</li>\n<li>Yếu cơ, Loạn dưỡng cơ</li>\n<li>Các chấn thương về cơ, xương, khớp</li>\n<li>...</li>\n</ul>\n','\n## Cơ Xương Khớp\n**Bác sĩ Cơ Xương Khớp giỏi**\n\nDanh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:\n* Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệm\n* Các giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu Khoa Cơ Xương Khớp - Bệnh viện Bạch Mai, Bệnh viện Hữu nghị Việt Đức,Bệnh Viện E.\n* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Cơ Xương Khớp, Hội Thấp khớp học,...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\n\n**Bệnh Cơ Xương Khớp**\n\n* Gout\n* Thoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổ\n* Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân\n* Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai\n* Loãng xương, đau nhức xương\n* Viêm xương, gai xương\n* Viêm cơ, Teo cơ, chứng đau mỏi cơ\n* Yếu cơ, Loạn dưỡng cơ\n* Các chấn thương về cơ, xương, khớp\n* ...\n\n\n', 'data:image/jpeg;base64,','2023-01-05 10:50:12','2023-02-03 16:52:45',true, 'data:image/jpeg;base64,',true,'<h2>Bác sĩ Cơ-Xương-Khớp từ xa</h2>\n<p><strong>TƯ VẤN KHÁM CHỮA BỆNH TỪ XA</strong></p>\n<p>Để đáp ứng nhu cầu chăm sóc sức khỏe Hậu COVID-19, BookingCare triển khai dịch vụ tư vấn khám chữa bệnh từ xa thông qua cuộc gọi có hình Video.</p>\n<p><strong>Bác sĩ chuyên khoa Cơ-Xương-Khớp khám từ xa</strong></p>\n<ul>\n<li>Chăm sóc sức khỏe ban đầu</li>\n<li>Chẩn đoán định hướng bệnh</li>\n<li>Định hướng phương pháp điều trị</li>\n<li>Tư vấn sử dụng thuốc</li>\n<li>Tư vấn xét nghiệm, chụp chiếu</li>\n<li>Người gặp các bệnh mãn tính</li>\n<li>Bệnh nhân cũ cần tái khám với bác sĩ từ xa</li>\n</ul>\n<p><strong>Các bệnh chuyên khoa Cơ-Xương-Khớp</strong></p>\n<ul>\n<li>Thoái hóa khớp</li>\n<li>Đau gối, Đau háng, Đau hông</li>\n<li>Đau các ngón chân, Đau cổ chân, bàn chân</li>\n<li>Bệnh Gout; Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân</li>\n<li>Đau nhiều khớp; Đau xương bánh chè</li>\n<li>Viêm màng hoạt dịch (khớp gối, háng, cổ chân, khớp khủy)</li>\n<li>Biến dạng khớp bàn chân, khớp gối, đi lạch bạch, yếu cơ, đau mỏi cơ</li>\n<li>Sưng khớp, nóng khớp, đỏ khớp, đau khớp</li>\n<li>Teo cơ Delta; Viêm gân gót, Viên gân Asin, Viêm gân gan chân</li>\n<li>Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai</li>\n<li>Viêm lồi cửa trước xương chày</li>\n<li>Thoái hóa sụn khớp, Rách sụn trên</li>\n</ul>\n<p><strong>Lợi ích khám tư vấn từ xa</strong></p>\n<ul>\n<li>Qui trình, thao tác đơn giản, nhanh gọn</li>\n<li>Đội ngũ bác sĩ chuyên khoa giàu kinh nghiệm và trách nhiệm cao</li>\n<li>Khám, tư vấn và điều trị hiệu quả chuyên sâu</li>\n<li>Kết nối mạng lưới nhiều Bệnh viện, phòng khám chuyên khoa sâu, rộng</li>\n<li>Tiện lợi, nhanh chóng, bệnh nhân tại nhà gặp bác sĩ từ xa.</li>\n<li>An toàn mùa Covid-19 cho bệnh nhân và gia đình</li>\n<li>Tiết kiệm chi phí, giảm tàu xe, ăn ở, thời gian chờ đợi.</li>\n</ul>\n','\n## Bác sĩ Cơ-Xương-Khớp từ xa\n**TƯ VẤN KHÁM CHỮA BỆNH TỪ XA**\n\nĐể đáp ứng nhu cầu chăm sóc sức khỏe Hậu COVID-19, BookingCare triển khai dịch vụ tư vấn khám chữa bệnh từ xa thông qua cuộc gọi có hình Video.\n\n**Bác sĩ chuyên khoa Cơ-Xương-Khớp khám từ xa**\n\n* Chăm sóc sức khỏe ban đầu\n* Chẩn đoán định hướng bệnh\n* Định hướng phương pháp điều trị\n* Tư vấn sử dụng thuốc\n* Tư vấn xét nghiệm, chụp chiếu\n* Người gặp các bệnh mãn tính\n* Bệnh nhân cũ cần tái khám với bác sĩ từ xa\n\n**Các bệnh chuyên khoa Cơ-Xương-Khớp**\n* Thoái hóa khớp\n* Đau gối, Đau háng, Đau hông\n* Đau các ngón chân, Đau cổ chân, bàn chân\n* Bệnh Gout; Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân\n* Đau nhiều khớp; Đau xương bánh chè\n* Viêm màng hoạt dịch (khớp gối, háng, cổ chân, khớp khủy)\n* Biến dạng khớp bàn chân, khớp gối, đi lạch bạch, yếu cơ, đau mỏi cơ\n* Sưng khớp, nóng khớp, đỏ khớp, đau khớp\n* Teo cơ Delta; Viêm gân gót, Viên gân Asin, Viêm gân gan chân\n* Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai\n* Viêm lồi cửa trước xương chày\n* Thoái hóa sụn khớp, Rách sụn trên\n\n**Lợi ích khám tư vấn từ xa**\n* Qui trình, thao tác đơn giản, nhanh gọn\n* Đội ngũ bác sĩ chuyên khoa giàu kinh nghiệm và trách nhiệm cao\n* Khám, tư vấn và điều trị hiệu quả chuyên sâu\n* Kết nối mạng lưới nhiều Bệnh viện, phòng khám chuyên khoa sâu, rộng\n* Tiện lợi, nhanh chóng, bệnh nhân tại nhà gặp bác sĩ từ xa.\n* An toàn mùa Covid-19 cho bệnh nhân và gia đình\n* Tiết kiệm chi phí, giảm tàu xe, ăn ở, thời gian chờ đợi.\n'),
(8,'SPE2','<h2>Thần kinh</h2>\n<p><strong>Bác sĩ Thần kinh giỏi</strong></p>\n<p>Danh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:</p>\n<ul>\n<li>Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh viện Đại học Y Hà Nội, Bệnh viện 103.</li>\n<li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.</li>\n</ul>\n<p><strong>Khám bệnh chuyên khoa Thần kinh</strong></p>\n<ul>\n<li>Bại Não</li>\n<li>Đau đầu, chóng mặt, buồn nôn</li>\n<li>Bệnh Pakison, bệnh tiền đình</li>\n<li>Bị co cơ, căng dây thần kinh</li>\n<li>Động kinh, có những cơn vãng ý thức</li>\n<li>Bị tê bì nửa mặt, chèn dây thần kinh</li>\n<li>Bồn chồn, lo lắng, hồi hộp, chân tay run</li>\n<li>Có dấu hiệu tăng động</li>\n<li>Co rút cổ, đau đầu với mặt, chân tay, vã mồ hôi</li>\n<li>Chấn thương đầu, dây thần kinh</li>\n<li>...</li>\n</ul>\n','\n## Thần kinh\n**Bác sĩ Thần kinh giỏi**\n\nDanh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:\n* Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh viện Đại học Y Hà Nội, Bệnh viện 103.\n* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.\n\n**Khám bệnh chuyên khoa Thần kinh**\n* Bại Não   \n* Đau đầu, chóng mặt, buồn nôn   \n* Bệnh Pakison, bệnh tiền đình   \n* Bị co cơ, căng dây thần kinh       \n* Động kinh, có những cơn vãng ý thức   \n* Bị tê bì nửa mặt, chèn dây thần kinh\n* Bồn chồn, lo lắng, hồi hộp, chân tay run   \n* Có dấu hiệu tăng động    \n* Co rút cổ, đau đầu với mặt, chân tay, vã mồ hôi   \n* Chấn thương đầu, dây thần kinh\n* ...', 'data:image/jpeg;base64,','2023-01-05 12:03:23','2023-01-14 12:08:17',true,NULL,false,NULL,NULL),
(9,'SPE3','<h2>Da liễu</h2>\n<p><strong>Bác sĩ Chuyên khoa Da liễu</strong></p>\n<p>BookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa da liễu giỏi tại Hà Nội.</p>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Da liễu Trung ương, Bệnh viện Da liễu Hà Nội</p>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>Bệnh vẩy nến, Da khô, Ngứa da</li>\n<li>Rám tàn nhang</li>\n<li>Mụn cóc sinh dục</li>\n<li>Nấm cơ thể, Nấm da đầu</li>\n<li>Nấm móng tay, móng chân</li>\n<li>Rụng tóc, hói đầu</li>\n<li>Viêm da dị ứng, Viêm da tiếp xúc, Viêm da tiết bã</li>\n<li>Viêm nang lông</li>\n<li>Xơ cứng bì</li>\n<li>Zona thần kinh</li>\n</ul>\n','\n## Da liễu\n**Bác sĩ Chuyên khoa Da liễu**\n\nBookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa da liễu giỏi tại Hà Nội.\n\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Da liễu Trung ương, Bệnh viện Da liễu Hà Nội\n\n**Khám và điều trị**\n* Bệnh vẩy nến, Da khô, Ngứa da\n* Rám tàn nhang\n* Mụn cóc sinh dục\n* Nấm cơ thể, Nấm da đầu\n* Nấm móng tay, móng chân\n* Rụng tóc, hói đầu\n* Viêm da dị ứng, Viêm da tiếp xúc, Viêm da tiết bã\n* Viêm nang lông\n* Xơ cứng bì\n* Zona thần kinh', 'data:image/jpeg;base64,','2023-01-05 15:50:31','2023-02-03 17:39:33',true, 'data:image/jpeg;base64,',true,'<h2><strong>Bác sĩ Da liễu từ xa</strong></h2>\n<h3><strong>Tư vấn khám chữa bệnh từ xa</strong></h3>\n<p>Để đáp ứng nhu cầu chăm sóc sức khỏe Hậu COVID-19, BookingCare triển khai dịch vụ tư vấn khám chữa bệnh từ xa thông qua cuộc gọi Video.</p>\n<h3><strong>Bác sĩ chuyên khoa da liễu từ xa</strong></h3>\n<ul>\n<li>Chăm sóc sức khỏe ban đầu</li>\n<li>Chẩn đoán định hướng bệnh</li>\n<li>Định hướng phương pháp điều trị</li>\n<li>Tư vấn sử dụng thuốc</li>\n<li>Tư vấn xét nghiệm, chụp chiếu</li>\n<li>Người gặp các bệnh mãn tính</li>\n<li>Bệnh nhân cũ cần tái khám với bác sĩ từ xa</li>\n</ul>\n<h3><strong>Các bệnh da liễu</strong></h3>\n<ul>\n<li>Bệnh ngoài da thường gặp và chuyên sâu, viêm da cơ địa, vảy nến, viêm da tiết bã (viêm da dầu),mày đay mạn tính, viêm da tiếp xúc, trứng cá, nấm da, một số bệnh lý da do nhiễm trùng, zona, thủy đậu, sùi mào gà, nám da, sẹo, mụn nhọt, rụng tóc...</li>\n</ul>\n<h3><strong>Lợi ích khám tư vấn từ xa</strong></h3>\n<ul>\n<li>Qui trình, thao tác đơn giản, nhanh gọn</li>\n<li>Đội ngũ bác sĩ chuyên khoa giàu kinh nghiệm và trách nhiệm cao</li>\n<li>Khám, tư vấn và điều trị hiệu quả chuyên sâu</li>\n<li>Kết nối mạng lưới nhiều Bệnh viện, phòng khám chuyên khoa sâu, rộng</li>\n<li>Tiện lợi, nhanh chóng, bệnh nhân tại nhà gặp bác sĩ từ xa.</li>\n<li>An toàn mùa Covid-19 cho bệnh nhân và gia đình</li>\n<li>Tiết kiệm chi phí, giảm tàu xe, ăn ở, thời gian chờ đợi.</li>\n</ul>\n','\n## **Bác sĩ Da liễu từ xa**\n\n### **Tư vấn khám chữa bệnh từ xa**\nĐể đáp ứng nhu cầu chăm sóc sức khỏe Hậu COVID-19, BookingCare triển khai dịch vụ tư vấn khám chữa bệnh từ xa thông qua cuộc gọi Video.\n\n### **Bác sĩ chuyên khoa da liễu từ xa**\n* Chăm sóc sức khỏe ban đầu\n* Chẩn đoán định hướng bệnh\n* Định hướng phương pháp điều trị\n* Tư vấn sử dụng thuốc\n* Tư vấn xét nghiệm, chụp chiếu\n* Người gặp các bệnh mãn tính\n* Bệnh nhân cũ cần tái khám với bác sĩ từ xa\n\n### **Các bệnh da liễu**\n* Bệnh ngoài da thường gặp và chuyên sâu, viêm da cơ địa, vảy nến, viêm da tiết bã (viêm da dầu),mày đay mạn tính, viêm da tiếp xúc, trứng cá, nấm da, một số bệnh lý da do nhiễm trùng, zona, thủy đậu, sùi mào gà, nám da, sẹo, mụn nhọt, rụng tóc...\n\n### **Lợi ích khám tư vấn từ xa**\n* Qui trình, thao tác đơn giản, nhanh gọn\n* Đội ngũ bác sĩ chuyên khoa giàu kinh nghiệm và trách nhiệm cao\n* Khám, tư vấn và điều trị hiệu quả chuyên sâu\n* Kết nối mạng lưới nhiều Bệnh viện, phòng khám chuyên khoa sâu, rộng\n* Tiện lợi, nhanh chóng, bệnh nhân tại nhà gặp bác sĩ từ xa.\n* An toàn mùa Covid-19 cho bệnh nhân và gia đình\n* Tiết kiệm chi phí, giảm tàu xe, ăn ở, thời gian chờ đợi.'),
(10,'SPE4','<h2>Tiêu hoá</h2>\n<p><strong>Bác sĩ Chuyên khoa Tiêu hóa</strong></p>\n<p>Danh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội</li>\n<li>Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...</li>\n</ul>\n<p><strong>Tư vấn, khám và điều trị các Bệnh Tiêu hóa</strong></p>\n<ul>\n<li>Ăn uống kém, không ngon</li>\n<li>Rối loạn tiêu hóa, táo bón, trĩ</li>\n<li>Nhiễm vi khuẩn HP (Helicobacter pylori)</li>\n<li>Nội soi dạ dày, đại tràng, tiêu hóa</li>\n<li>Buồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi</li>\n<li>Co thắt thực quản, Hội chứng ruột kích thích</li>\n<li>Đau bụng, dạ dày, đại tràng, thượng vị</li>\n<li>Viêm đại tràng, dạ dày, tá tràng</li>\n<li>Ung thư dạ dày, U nang tuyến tụy</li>\n<li>Bệnh lý về gan, mật</li>\n<li>...</li>\n</ul>\n','\n## Tiêu hoá\n**Bác sĩ Chuyên khoa Tiêu hóa**\n\nDanh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội\n* Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...\n\n**Tư vấn, khám và điều trị các Bệnh Tiêu hóa**\n* Ăn uống kém, không ngon\n* Rối loạn tiêu hóa, táo bón, trĩ\n* Nhiễm vi khuẩn HP (Helicobacter pylori)\n* Nội soi dạ dày, đại tràng, tiêu hóa\n* Buồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi\n* Co thắt thực quản, Hội chứng ruột kích thích\n* Đau bụng, dạ dày, đại tràng, thượng vị\n* Viêm đại tràng, dạ dày, tá tràng\n* Ung thư dạ dày, U nang tuyến tụy\n* Bệnh lý về gan, mật\n* ...', 'data:image/jpeg;base64,','2023-01-05 15:51:58','2023-02-03 16:45:28',true, 'data:image/jpeg;base64,',true,'<h2><strong>Bác sĩ Tiêu hóa từ xa</strong></h2>\n<p><strong>TƯ VẤN KHÁM CHỮA BỆNH TỪ XA</strong></p>\n<p>Để đáp ứng nhu cầu chăm sóc sức khỏe Hậu COVID-19, BookingCare triển khai dịch vụ tư vấn khám chữa bệnh từ xa thông qua cuộc gọi Video.</p>\n<p><strong>Bác sĩ chuyên khoa Tiêu hóa khám từ xa</strong></p>\n<ul>\n<li>Chăm sóc sức khỏe ban đầu</li>\n<li>Chẩn đoán định hướng bệnh</li>\n<li>Định hướng phương pháp điều trị</li>\n<li>Tư vấn sử dụng thuốc</li>\n<li>Tư vấn xét nghiệm, chụp chiếu</li>\n<li>Người gặp các bệnh mãn tính</li>\n<li>Bệnh nhân cũ cần tái khám với bác sĩ từ xa</li>\n</ul>\n<p><strong>Các bệnh chuyên khoa Tiêu hóa</strong></p>\n<ul>\n<li>Đau dạ dày</li>\n<li>Trào ngược dạ dày - thực quản</li>\n<li>Viêm hang vị dạ dày; Viêm, loét dạ dày; Viêm, loét tá tràng</li>\n<li>Polyp dạ dày, ung thư dạ dày …</li>\n<li>Đau thượng vị; Khó nuốt; Khó tiêu; Táo bón</li>\n<li>Hội chứng ruột kích thích</li>\n<li>Bệnh lý không dung nạp lactose</li>\n<li>Viêm đại tràng</li>\n<li>Đi ngoài ra máu</li>\n<li>Nứt kẽ hậu môn, đại tiện khó</li>\n</ul>\n<p><strong>Lợi ích khám tư vấn từ xa</strong></p>\n<ul>\n<li>Qui trình, thao tác đơn giản, nhanh gọn</li>\n<li>Đội ngũ bác sĩ chuyên khoa giàu kinh nghiệm và trách nhiệm cao</li>\n<li>Khám, tư vấn và điều trị hiệu quả chuyên sâu</li>\n<li>Kết nối mạng lưới nhiều Bệnh viện, phòng khám chuyên khoa sâu, rộng</li>\n<li>Tiện lợi, nhanh chóng, bệnh nhân tại nhà gặp bác sĩ từ xa.</li>\n<li>An toàn mùa Covid-19 cho bệnh nhân và gia đình</li>\n<li>Tiết kiệm chi phí, giảm tàu xe, ăn ở, thời gian chờ đợi.</li>\n</ul>\n','\n## **Bác sĩ Tiêu hóa từ xa**\n\n**TƯ VẤN KHÁM CHỮA BỆNH TỪ XA**\n\nĐể đáp ứng nhu cầu chăm sóc sức khỏe Hậu COVID-19, BookingCare triển khai dịch vụ tư vấn khám chữa bệnh từ xa thông qua cuộc gọi Video.\n\n**Bác sĩ chuyên khoa Tiêu hóa khám từ xa**\n\n* Chăm sóc sức khỏe ban đầu\n* Chẩn đoán định hướng bệnh\n* Định hướng phương pháp điều trị\n* Tư vấn sử dụng thuốc\n* Tư vấn xét nghiệm, chụp chiếu\n* Người gặp các bệnh mãn tính\n* Bệnh nhân cũ cần tái khám với bác sĩ từ xa\n\n**Các bệnh chuyên khoa Tiêu hóa**\n* Đau dạ dày\n* Trào ngược dạ dày - thực quản\n* Viêm hang vị dạ dày; Viêm, loét dạ dày; Viêm, loét tá tràng\n* Polyp dạ dày, ung thư dạ dày …\n* Đau thượng vị; Khó nuốt; Khó tiêu; Táo bón\n* Hội chứng ruột kích thích\n* Bệnh lý không dung nạp lactose\n* Viêm đại tràng\n* Đi ngoài ra máu\n* Nứt kẽ hậu môn, đại tiện khó\n\n**Lợi ích khám tư vấn từ xa**\n* Qui trình, thao tác đơn giản, nhanh gọn\n* Đội ngũ bác sĩ chuyên khoa giàu kinh nghiệm và trách nhiệm cao\n* Khám, tư vấn và điều trị hiệu quả chuyên sâu\n* Kết nối mạng lưới nhiều Bệnh viện, phòng khám chuyên khoa sâu, rộng\n* Tiện lợi, nhanh chóng, bệnh nhân tại nhà gặp bác sĩ từ xa.\n* An toàn mùa Covid-19 cho bệnh nhân và gia đình\n* Tiết kiệm chi phí, giảm tàu xe, ăn ở, thời gian chờ đợi.'),
(11,'SPE5','<h2>Tim mạch</h2>\n<p><strong>Bác sĩ tim mạch giỏi</strong></p>\n<p>Danh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:</p>\n<ul>\n<li>Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.</li>\n<li>Các giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà Nội</li>\n<li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt Nam</li>\n<li>Đạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</li>\n</ul>\n<p><strong>Khám tư vấn tim mạch</strong></p>\n<ul>\n<li>Khó thở, Đau ngực, đau tim</li>\n<li>Tăng huyết áp, hạ huyết áp</li>\n<li>Rối loạn mỡ máu, cao huyết áp, chóng mặt</li>\n<li>Bệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ</li>\n<li>Cảm giác hồi hộp, tim đập nhanh</li>\n<li>Tim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến</li>\n<li>Đã đặt stent tim, nong động mạch vành</li>\n<li>Giãn tĩnh mạch chân</li>\n<li>...</li>\n</ul>\n','\n## Tim mạch\n**Bác sĩ tim mạch giỏi**\n\nDanh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:\n* Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.\n* Các giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà Nội\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà Nội\n* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt Nam\n* Đạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\n\n**Khám tư vấn tim mạch**\n* Khó thở, Đau ngực, đau tim\n* Tăng huyết áp, hạ huyết áp\n* Rối loạn mỡ máu, cao huyết áp, chóng mặt\n* Bệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ\n* Cảm giác hồi hộp, tim đập nhanh   \n* Tim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến   \n* Đã đặt stent tim, nong động mạch vành\n* Giãn tĩnh mạch chân   \n* ...', 'data:image/jpeg;base64,','2023-01-05 15:53:07','2023-01-14 12:08:27',true,NULL,false,NULL,NULL),
(12,'SPE6','<h2>Tai Mũi Họng</h2>\n<p><strong>Bác sĩ Chuyên khoa Tai Mũi Họng</strong></p>\n<p><strong>Danh sách các bác sĩ uy tín đầu ngành tại Việt Nam:</strong></p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tai Mũi Họng tại Hà Nội</li>\n<li>Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Tai Mũi Họng Trung ương, Bệnh viện Quân Y 108...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ cao cấp,...</li>\n</ul>\n<p><strong>Các bệnh Tai Mũi Họng</strong></p>\n<ul>\n<li>Ù tai, đau tai, chảy máu tai</li>\n<li>Thủng màng nhĩ, điếc đột ngột</li>\n<li>Viêm tai giữa</li>\n<li>Amidan, V.A</li>\n<li>Viêm xoang</li>\n<li>Nghẹt mũi</li>\n<li>Hay bị chảy máu cam</li>\n<li>Đau cổ họng, khó nuốt</li>\n<li>Ho kéo dài</li>\n<li>Ngủ ngáy</li>\n<li>...</li>\n</ul>\n','\n## Tai Mũi Họng\n**Bác sĩ Chuyên khoa Tai Mũi Họng**\n\n**Danh sách các bác sĩ uy tín đầu ngành tại Việt Nam:**\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tai Mũi Họng tại Hà Nội\n* Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Tai Mũi Họng Trung ương, Bệnh viện Quân Y 108...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ cao cấp,...\n\n**Các bệnh Tai Mũi Họng**\n* Ù tai, đau tai, chảy máu tai\n* Thủng màng nhĩ, điếc đột ngột\n* Viêm tai giữa\n* Amidan, V.A\n* Viêm xoang\n* Nghẹt mũi\n* Hay bị chảy máu cam\n* Đau cổ họng, khó nuốt\n* Ho kéo dài\n* Ngủ ngáy\n* ...', 'data:image/jpeg;base64,','2023-01-05 15:54:23','2023-02-03 16:57:06',true, 'data:image/jpeg;base64,',true,'<h2><strong>Bác sĩ Tai-Mũi-Họng từ xa</strong></h2>\n<p><strong>TƯ VẤN KHÁM CHỮA BỆNH TỪ XA</strong></p>\n<p>Để đáp ứng nhu cầu chăm sóc sức khỏe Hậu COVID-19, BookingCare triển khai dịch vụ tư vấn khám chữa bệnh từ xa thông qua cuộc gọi Video.</p>\n<p><strong>Bác sĩ chuyên khoa Tai Mũi Họng khám từ xa</strong></p>\n<ul>\n<li>Chăm sóc sức khỏe ban đầu</li>\n<li>Chẩn đoán định hướng bệnh</li>\n<li>Định hướng phương pháp điều trị</li>\n<li>Tư vấn sử dụng thuốc</li>\n<li>Tư vấn xét nghiệm, chụp chiếu</li>\n<li>Người gặp các bệnh mãn tính</li>\n<li>Bệnh nhân cũ cần tái khám với bác sĩ từ xa</li>\n</ul>\n<p><strong>Các bệnh chuyên khoa Tai Mũi Họng</strong></p>\n<p><strong>Các bệnh về tai</strong></p>\n<ul>\n<li>Ù tai, nghe kém, điếc đột ngột</li>\n<li>Chẩy mủ tai, viêm tai giữa cấp, mạn.</li>\n<li>Phát hiện sớm và điều trị viêm tai giữa màng nhĩ đóng kín, không chẩy mủ ra ngoài...</li>\n</ul>\n<p><strong>Các bệnh mũi xoang</strong></p>\n<ul>\n<li>Viêm mũi xoang dị ứng, viêm mũi vận mạch; Viêm mũi ngạt tắc mũi mạn tính</li>\n<li>Viêm đa xoang mạn lâu ngày khó khỏi, polyp mũi xoang</li>\n<li>Đau đầu mạn tính do mũi xoang…</li>\n</ul>\n<p><strong>Các bệnh về họng thanh quản</strong></p>\n<ul>\n<li>Viêm mũi họng mạn tính</li>\n<li>Viêm tai thanh dịch; Viêm tai giữa cấp</li>\n<li>Viêm thanh khí phế quản; Viêm amiđan cấp, mạn...</li>\n</ul>\n<p><strong>Lợi ích khám tư vấn từ xa</strong></p>\n<ul>\n<li>Qui trình, thao tác đơn giản, nhanh gọn</li>\n<li>Đội ngũ bác sĩ chuyên khoa giàu kinh nghiệm và trách nhiệm cao</li>\n<li>Khám, tư vấn và điều trị hiệu quả chuyên sâu</li>\n<li>Kết nối mạng lưới nhiều Bệnh viện, phòng khám chuyên khoa sâu, rộng</li>\n<li>Tiện lợi, nhanh chóng, bệnh nhân tại nhà gặp bác sĩ từ xa.</li>\n<li>An toàn mùa Covid-19 cho bệnh nhân và gia đình</li>\n<li>Tiết kiệm chi phí, giảm tàu xe, ăn ở, thời gian chờ đợi.</li>\n</ul>\n','\n## **Bác sĩ Tai-Mũi-Họng từ xa**\n\n**TƯ VẤN KHÁM CHỮA BỆNH TỪ XA**\n\nĐể đáp ứng nhu cầu chăm sóc sức khỏe Hậu COVID-19, BookingCare triển khai dịch vụ tư vấn khám chữa bệnh từ xa thông qua cuộc gọi Video.\n\n**Bác sĩ chuyên khoa Tai Mũi Họng khám từ xa**\n\n* Chăm sóc sức khỏe ban đầu\n* Chẩn đoán định hướng bệnh\n* Định hướng phương pháp điều trị\n* Tư vấn sử dụng thuốc\n* Tư vấn xét nghiệm, chụp chiếu\n* Người gặp các bệnh mãn tính\n* Bệnh nhân cũ cần tái khám với bác sĩ từ xa\n\n**Các bệnh chuyên khoa Tai Mũi Họng**\n\n**Các bệnh về tai**\n\n* Ù tai, nghe kém, điếc đột ngột\n* Chẩy mủ tai, viêm tai giữa cấp, mạn.\n* Phát hiện sớm và điều trị viêm tai giữa màng nhĩ đóng kín, không chẩy mủ ra ngoài...\n\n**Các bệnh mũi xoang**\n\n* Viêm mũi xoang dị ứng, viêm mũi vận mạch; Viêm mũi ngạt tắc mũi mạn tính\n* Viêm đa xoang mạn lâu ngày khó khỏi, polyp mũi xoang\n* Đau đầu mạn tính do mũi xoang…\n\n**Các bệnh về họng thanh quản**\n\n* Viêm mũi họng mạn tính\n* Viêm tai thanh dịch; Viêm tai giữa cấp\n* Viêm thanh khí phế quản; Viêm amiđan cấp, mạn...\n\n**Lợi ích khám tư vấn từ xa**\n\n* Qui trình, thao tác đơn giản, nhanh gọn\n* Đội ngũ bác sĩ chuyên khoa giàu kinh nghiệm và trách nhiệm cao\n* Khám, tư vấn và điều trị hiệu quả chuyên sâu\n* Kết nối mạng lưới nhiều Bệnh viện, phòng khám chuyên khoa sâu, rộng\n* Tiện lợi, nhanh chóng, bệnh nhân tại nhà gặp bác sĩ từ xa.\n* An toàn mùa Covid-19 cho bệnh nhân và gia đình\n* Tiết kiệm chi phí, giảm tàu xe, ăn ở, thời gian chờ đợi.'),
(13,'SPE18','<p>TEST</p>\n','TEST', 'data:image/jpeg;base64,','2023-02-03 16:37:33','2023-02-03 16:37:33',false, 'data:image/jpeg;base64,',true,'<h2>Tư vấn, trị liệu Tâm lý từ xa</h2>\n<h3><strong>Chuyên gia tư vấn Tâm lý giỏi</strong></h3>\n<ul>\n<li>BookingCare là Nền tảng Y tế chăm sóc Sức khỏe toàn diện, trong đó có cung cấp dịch vụ tư vấn tâm lý từ xa.</li>\n<li>Chuyên gia được đào tạo bài bản về chuyên ngành Tâm lý tại các trường đại học trong nước và quốc tế.</li>\n<li>Nhà Tâm lý học là những người có nhiều kinh nghiệm trong lĩnh vực tâm lý, chăm sóc sức khỏe tinh thần.</li>\n<li>Các nhà chuyên môn nghiên cứu, tư vấn và trị liệu theo các phương pháp tiếp cận mới, hiệu quả.</li>\n<li>Lắng nghe và thấu hiểu khách hàng để giúp họ vượt qua khó khăn của bản thân.</li>\n</ul>\n<h3><strong>Tư vấn và trị liệu</strong></h3>\n<ul>\n<li>Khó khăn, rối nhiễu tâm lý</li>\n<li>Phát triển cá nhân</li>\n<li>Mâu thuẫn, lạm dụng và tổn thương tâm lý</li>\n<li>Tái hòa nhập xã hội</li>\n<li>Vấn đề khuyết tật và nhóm yếu thế</li>\n<li>Những vấn đề của vị thành niên</li>\n<li>Giới tính và tình dục</li>\n<li>Những vấn đề trong mối quan hệ gia đình</li>\n</ul>\n<p>Ngoài những vấn đề nêu trên, khách hàng có thể liên hệ với chúng tôi để được hỗ trợ, sắp xếp lịch tư vấn phù hợp</p>\n','\n## Tư vấn, trị liệu Tâm lý từ xa\n\n### **Chuyên gia tư vấn Tâm lý giỏi**\n* BookingCare là Nền tảng Y tế chăm sóc Sức khỏe toàn diện, trong đó có cung cấp dịch vụ tư vấn tâm lý từ xa.\n* Chuyên gia được đào tạo bài bản về chuyên ngành Tâm lý tại các trường đại học trong nước và quốc tế.\n* Nhà Tâm lý học là những người có nhiều kinh nghiệm trong lĩnh vực tâm lý, chăm sóc sức khỏe tinh thần.\n* Các nhà chuyên môn nghiên cứu, tư vấn và trị liệu theo các phương pháp tiếp cận mới, hiệu quả.\n* Lắng nghe và thấu hiểu khách hàng để giúp họ vượt qua khó khăn của bản thân.\n\n\n### **Tư vấn và trị liệu**\n* Khó khăn, rối nhiễu tâm lý\n* Phát triển cá nhân\n* Mâu thuẫn, lạm dụng và tổn thương tâm lý\n* Tái hòa nhập xã hội\n* Vấn đề khuyết tật và nhóm yếu thế\n* Những vấn đề của vị thành niên\n* Giới tính và tình dục\n* Những vấn đề trong mối quan hệ gia đình\n\nNgoài những vấn đề nêu trên, khách hàng có thể liên hệ với chúng tôi để được hỗ trợ, sắp xếp lịch tư vấn phù hợp\n \n'),
(14,'SPE19','<p>Null</p>\n','Null', 'data:image/jpeg;base64,','2023-02-03 16:48:42','2023-02-03 16:48:42',false, 'data:image/jpeg;base64,',true,'<h2><strong>Sức khỏe tâm thần từ xa</strong></h2>\n<p><strong>Tư vấn, khám chữa bệnh từ xa</strong></p>\n<p>Để đáp ứng nhu cầu chăm sóc sức khỏe Hậu COVID-19, BookingCare triển khai dịch vụ tư vấn khám chữa bệnh từ xa thông qua cuộc gọi Video.</p>\n<p><strong>Bác sĩ chuyên khoa Sức khỏe tâm thần từ xa</strong></p>\n<ul>\n<li>Chăm sóc sức khỏe ban đầu</li>\n<li>Chẩn đoán định hướng bệnh</li>\n<li>Định hướng phương pháp điều trị</li>\n<li>Tư vấn sử dụng thuốc</li>\n<li>Tư vấn xét nghiệm, chụp chiếu</li>\n<li>Người gặp các bệnh mãn tính</li>\n<li>Bệnh nhân cũ cần tái khám với bác sĩ từ xa</li>\n</ul>\n<p><strong>Các bệnh chuyên khoa Tâm thần (Tâm bệnh)</strong></p>\n<ul>\n<li>Rối loạn lo âu, hoa mắt chóng mặt</li>\n<li>Rối loạn tiền đình; Rối loạn thần kinh thực vật</li>\n<li>Trầm cảm</li>\n<li>Mất ngủ, khó ngủ, khó duy trì giấc ngủ, dậy quá sớm, ngủ dậy vẫn thấy mệt, tỉnh dậy nhiều lần trong giấc ngủ.</li>\n<li>Đau đầu, đau lưng, đau mỏi vai gáy, mệt mỏi mạn tính, mất ngủ, bồn chồn, dễ cáu kỉnh, tự đánh giá thấp bản thân</li>\n<li>Căng thẳng tâm lý, suy nghĩ tiêu cực, bi quan và tuyệt vọng kéo dài.</li>\n<li>Rối loạn lưỡng cực cảm xúc</li>\n<li>Tâm thần phân liệt, có thể kích động, khả năng học tập lao động giảm dần, ngày càng thờ ơ, vô cảm.</li>\n<li>Rối loạn tăng động giảm chú ý (ADHD)</li>\n<li>Nghiện game, Nghiện rượu, thuốc lá, Nghiện ma túy tổng hợp...</li>\n</ul>\n<p><strong>Lợi ích khám tư vấn từ xa</strong></p>\n<ul>\n<li>Qui trình, thao tác đơn giản, nhanh gọn</li>\n<li>Đội ngũ bác sĩ chuyên khoa giàu kinh nghiệm và trách nhiệm cao</li>\n<li>Khám, tư vấn và điều trị hiệu quả chuyên sâu</li>\n<li>Kết nối mạng lưới nhiều bệnh viện, phòng khám chuyên khoa sâu, rộng</li>\n<li>Tiện lợi, nhanh chóng, bệnh nhân tại nhà gặp bác sĩ từ xa.</li>\n<li>An toàn mùa Covid-19 cho bệnh nhân và gia đình</li>\n<li>Tiết kiệm chi phí, giảm tàu xe, ăn ở, thời gian chờ đợi.</li>\n</ul>\n','\n## **Sức khỏe tâm thần từ xa**\n\n**Tư vấn, khám chữa bệnh từ xa**\n\nĐể đáp ứng nhu cầu chăm sóc sức khỏe Hậu COVID-19, BookingCare triển khai dịch vụ tư vấn khám chữa bệnh từ xa thông qua cuộc gọi Video.\n\n**Bác sĩ chuyên khoa Sức khỏe tâm thần từ xa**\n\n* Chăm sóc sức khỏe ban đầu\n* Chẩn đoán định hướng bệnh\n* Định hướng phương pháp điều trị\n* Tư vấn sử dụng thuốc\n* Tư vấn xét nghiệm, chụp chiếu\n* Người gặp các bệnh mãn tính\n* Bệnh nhân cũ cần tái khám với bác sĩ từ xa\n\n**Các bệnh chuyên khoa Tâm thần (Tâm bệnh)**\n\n* Rối loạn lo âu, hoa mắt chóng mặt\n* Rối loạn tiền đình; Rối loạn thần kinh thực vật\n* Trầm cảm\n* Mất ngủ, khó ngủ, khó duy trì giấc ngủ, dậy quá sớm, ngủ dậy vẫn thấy mệt, tỉnh dậy nhiều lần trong giấc ngủ.\n* Đau đầu, đau lưng, đau mỏi vai gáy, mệt mỏi mạn tính, mất ngủ, bồn chồn, dễ cáu kỉnh, tự đánh giá thấp bản thân\n* Căng thẳng tâm lý, suy nghĩ tiêu cực, bi quan và tuyệt vọng kéo dài.\n* Rối loạn lưỡng cực cảm xúc\n* Tâm thần phân liệt, có thể kích động, khả năng học tập lao động giảm dần, ngày càng thờ ơ, vô cảm.\n* Rối loạn tăng động giảm chú ý (ADHD)\n* Nghiện game, Nghiện rượu, thuốc lá, Nghiện ma túy tổng hợp...\n\n**Lợi ích khám tư vấn từ xa**\n\n* Qui trình, thao tác đơn giản, nhanh gọn\n* Đội ngũ bác sĩ chuyên khoa giàu kinh nghiệm và trách nhiệm cao\n* Khám, tư vấn và điều trị hiệu quả chuyên sâu\n* Kết nối mạng lưới nhiều bệnh viện, phòng khám chuyên khoa sâu, rộng\n* Tiện lợi, nhanh chóng, bệnh nhân tại nhà gặp bác sĩ từ xa.\n* An toàn mùa Covid-19 cho bệnh nhân và gia đình\n* Tiết kiệm chi phí, giảm tàu xe, ăn ở, thời gian chờ đợi.');

