(5,'CLI3','','PRI8','PRO2','PAY3','Gói khám sức khỏe tổng quát cơ bản cho nữ','Basic general health checkup package for women','20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. HCM','<p>Gói khám bao gồm: Khám lâm sàng, Xét nghiệm máu, xét nghiệm chức năng gan, thận, chức năng chuyển hóa, chụp Xquang, siêu âm ổ bụng, điện tim.</p>\n<p>Gói khám tại Phòng khám Bệnh viện Đại học Y dược 1</p>\n','Gói khám bao gồm: Khám lâm sàng, Xét nghiệm máu, xét nghiệm chức năng gan, thận, chức năng chuyển hóa, chụp Xquang, siêu âm ổ bụng, điện tim.\n\nGói khám tại Phòng khám Bệnh viện Đại học Y dược 1','<h2><strong>Gói khám sức khỏe tổng quát cơ bản cho nữ</strong></h2>\n<p><strong>Gói khám bao gồm:</strong></p>\n<ul>\n<li>Khám lâm sàng</li>\n<li>Xét nghiệm máu</li>\n<li>Xét nghiệm chức năng gan, thận</li>\n<li>Xét nghiệm chức năng chuyển hóa</li>\n<li>Điện tim</li>\n<li>Siêu âm ổ bụng</li>\n<li>Chụp X-quang tim phổi</li>\n</ul>\n<p>Gói khám tại Phòng khám Bệnh viện Đại học Y dược 1. Gói khám được chia thành các danh mục cho nữ giới đã lập gia đình và nữ giới độc thân.</p>\n','\n## **Gói khám sức khỏe tổng quát cơ bản cho nữ**\n**Gói khám bao gồm:**\n* Khám lâm sàng\n* Xét nghiệm máu\n* Xét nghiệm chức năng gan, thận\n* Xét nghiệm chức năng chuyển hóa\n* Điện tim\n* Siêu âm ổ bụng\n* Chụp X-quang tim phổi\n\nGói khám tại Phòng khám Bệnh viện Đại học Y dược 1. Gói khám được chia thành các danh mục cho nữ giới đã lập gia đình và nữ giới độc thân.','<h2><strong>Danh mục Gói khám</strong></h2>\n<h3><strong>Khám lâm sàng</strong></h3>\n<ol>\n<li>Khám nội</li>\n<li>Đo huyết áp, nhịp tim, chỉ số BMI</li>\n</ol>\n<ul>\n<li>Kiểm tra mạch, huyết áp, cân nặng, chiều cao, tính chỉ số BMI nhằm phát hiện tăng huyết áp, rối loạn nhịp tim, thừa cân, béo phì</li>\n</ul>\n<ol start=\"3\">\n<li>\n<p>Khám mắt, đo thị lực</p>\n</li>\n<li>\n<p>Khám tai mũi họng</p>\n</li>\n<li>\n<p>Khám răng</p>\n</li>\n<li>\n<p>Khám phụ khoa (Dành cho phụ nữ đã lập gia đình)</p>\n</li>\n</ol>\n<h3><strong>Xét nghiệm</strong></h3>\n<ol>\n<li>Định lượng glucose máu: Tầm soát đái tháo đường, rối loạn dung nạp đường</li>\n<li>Định lượng Creatinin: Đánh giá chức năng thận</li>\n<li>Đo hoạt độ ALT (GPT),AST (GOT),GGT: Kiểm tra men gan, đánh giá tình trạng tổn thương của tế bảo gan trong một số bệnh gan mật</li>\n</ol>\n','\n## **Danh mục Gói khám**\n\n### **Khám lâm sàng**\n\n\n1. Khám nội\n2. Đo huyết áp, nhịp tim, chỉ số BMI\n* Kiểm tra mạch, huyết áp, cân nặng, chiều cao, tính chỉ số BMI nhằm phát hiện tăng huyết áp, rối loạn nhịp tim, thừa cân, béo phì\n3. Khám mắt, đo thị lực\n\n4. Khám tai mũi họng\n5. Khám răng\n6. Khám phụ khoa (Dành cho phụ nữ đã lập gia đình)\n\n\n### **Xét nghiệm**\n1. Định lượng glucose máu: Tầm soát đái tháo đường, rối loạn dung nạp đường\n2. Định lượng Creatinin: Đánh giá chức năng thận\n3. Đo hoạt độ ALT (GPT),AST (GOT),GGT: Kiểm tra men gan, đánh giá tình trạng tổn thương của tế bảo gan trong một số bệnh gan mật','2023-01-16 16:31:38','2023-01-31 12:26:31'),
(6,'CLI1','SPE12','PRI7','PRO1','PAY3','Khám với Giáo sư, Phó giáo sư, Tiến sĩ, Bác sĩ Chuyên khoa II, Trưởng khoa của  Chi trên và y học thể thao (BVHNVĐ)','Examination with Professor, Associate Professor, Doctor, Specialist II, Head of Upper Extremity and Sports Medicine (VĐ Hospital)','Nhà C4, Tầng 1, số 16-18 Phủ Doãn, Phường Hàng Bông, Quận Hoàn Kiếm, Hà Nội','<p>Giáo sư, tiến sĩ, bác sĩ giàu kinh nghiệm</p>\n<p>Hỗ trợ đặt lịch khám trực tuyến</p>\n<p>Giảm thời gian chờ đợi, ưu tiên khám nhanh</p>\n','Giáo sư, tiến sĩ, bác sĩ giàu kinh nghiệm\n\nHỗ trợ đặt lịch khám trực tuyến\n\nGiảm thời gian chờ đợi, ưu tiên khám nhanh','<h3><strong>Khám theo yêu cầu khoa Chi trên và Y học thể thao - Giáo sư, Phó Giáo sư, Tiến sĩ, BSCKII, Trưởng khoa, Phó khoa</strong></h3>\n<p>Nhằm đáp ứng nhu cầu sử dụng dịch vụ y tế chất lượng cao, giảm thiểu thủ tục hành chính cho người bệnh và nâng cao phong cách phục vụ chuyên nghiệp, Bệnh viện Việt Đức cung cấp dịch vụ khám theo yêu cầu.</p>\n<ul>\n<li>Hỗ trợ đăng ký khám trực tuyến, đặt lịch khám bệnh</li>\n<li>Giảm thời gian chờ đợi, ưu tiên khám nhanh</li>\n<li>Hỗ trợ thực hiện chụp chiếu, xét nghiệm, cận lâm sàng.</li>\n</ul>\n<p>Sử dụng dịch vụ khám yêu cầu tại bệnh viện Việt Đức, người bệnh sẽ được lựa chọn các giáo sư, tiến sĩ, bác sĩ giàu kinh nghiệm, sự hỗ trợ đắc lực của hệ thống máy móc, trang thiết bị hiện đại để chẩn đoán chính xác, điều trị hiệu quả.</p>\n<p>Dịch vụ khám yêu cầu cũng giúp người bệnh hoàn thiện các thủ tục hành chính nhanh gọn, nhận kết quả khám trong thời gian sớm hơn.</p>\n<h3><strong>Khám chi trên tại Bệnh viện Việt Đức</strong></h3>\n<ul>\n<li>Khám bệnh và điều trị nội trú, phẫu thuật chuyên sâu cho những bệnh nhân bị bệnh lý về chấn thương và chỉnh hình.</li>\n<li>Khám các bệnh lý do chấn thương thể thao</li>\n<li>Khám, tư vấn, điều trị các bệnh lý về xương khớp</li>\n<li>Khám, điều trị thoái hóa khớp gối không phẫu thuật</li>\n<li>Các vấn đề về chấn thương và điều trị sau chấn thương cơ xương khớp và cột sống</li>\n<li>Thoái hóa khớp gối, khớp háng</li>\n<li>Bệnh lý đứt dây chằng gối</li>\n<li>Chấn thương chỉnh hình xương khớp</li>\n<li>Các bệnh lý về nội cơ xương khớp</li>\n<li>Viêm khớp</li>\n<li>Phẫu thuật bàn tay, bàn chân</li>\n</ul>\n<h3><strong>Chi phí khám với bác sĩ</strong></h3>\n<ul>\n<li>Khám Giáo sư, Phó Giáo sư, Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí 500.000 đồng/lần khám</li>\n<li>Khám với bác sĩ Trưởng khoa hoặc Phó khoa - Chi phí 500.000 đồng/lần khám</li>\n</ul>\n','\n### **Khám theo yêu cầu khoa Chi trên và Y học thể thao - Giáo sư, Phó Giáo sư, Tiến sĩ, BSCKII, Trưởng khoa, Phó khoa**\nNhằm đáp ứng nhu cầu sử dụng dịch vụ y tế chất lượng cao, giảm thiểu thủ tục hành chính cho người bệnh và nâng cao phong cách phục vụ chuyên nghiệp, Bệnh viện Việt Đức cung cấp dịch vụ khám theo yêu cầu.\n\n* Hỗ trợ đăng ký khám trực tuyến, đặt lịch khám bệnh\n* Giảm thời gian chờ đợi, ưu tiên khám nhanh\n* Hỗ trợ thực hiện chụp chiếu, xét nghiệm, cận lâm sàng.\n\nSử dụng dịch vụ khám yêu cầu tại bệnh viện Việt Đức, người bệnh sẽ được lựa chọn các giáo sư, tiến sĩ, bác sĩ giàu kinh nghiệm, sự hỗ trợ đắc lực của hệ thống máy móc, trang thiết bị hiện đại để chẩn đoán chính xác, điều trị hiệu quả.\n\nDịch vụ khám yêu cầu cũng giúp người bệnh hoàn thiện các thủ tục hành chính nhanh gọn, nhận kết quả khám trong thời gian sớm hơn.\n\n\n### **Khám chi trên tại Bệnh viện Việt Đức**\n* Khám bệnh và điều trị nội trú, phẫu thuật chuyên sâu cho những bệnh nhân bị bệnh lý về chấn thương và chỉnh hình.\n* Khám các bệnh lý do chấn thương thể thao\n* Khám, tư vấn, điều trị các bệnh lý về xương khớp\n* Khám, điều trị thoái hóa khớp gối không phẫu thuật\n* Các vấn đề về chấn thương và điều trị sau chấn thương cơ xương khớp và cột sống\n* Thoái hóa khớp gối, khớp háng\n* Bệnh lý đứt dây chằng gối\n* Chấn thương chỉnh hình xương khớp\n* Các bệnh lý về nội cơ xương khớp\n* Viêm khớp\n* Phẫu thuật bàn tay, bàn chân\n\n\n### **Chi phí khám với bác sĩ**\n* Khám Giáo sư, Phó Giáo sư, Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí 500.000 đồng/lần khám\n* Khám với bác sĩ Trưởng khoa hoặc Phó khoa - Chi phí 500.000 đồng/lần khám','','','2023-02-02 11:53:43','2023-02-02 11:57:05');
